const baseURL = "http://127.0.0.1:4000/";
const regularURL = "http://localhost:3000";

const [Catagories, setProducts] = useState([]);
const [Categories, setCategories] = React.useState(null);
const [error, setError] = React.useState(null);






return (
  <div>
      <div className="bg-slate-800 p-3" style={{ width: '100%', border: '2px solid black' }}>
          <div className="flex items-center" style={{ border: '2px solid black', flexDirection: 'row' }}>
              <div style={{ flexGrow: 1, fontSize: '50px', fontWeight: 'bold', color: 'black', fontFamily: 'fantasy' }}>   <img className="h-10 mr-3" style={{ maxWidth: '200px', maxHeight: '200px', padding: '5px' }} src={logo} alt="Logo" />Peninsula Parking</div>
